import React from 'react';
import Search from '../shared/Search';

function Landing({ history }) {
    function handleSearch(e) {
        e.preventDefault();
        history.pushState('/results');
    }

    return (
        <div>
            <Search handleSearch={handleSearch} />
        </div>
    );
}

export default Landing;
